INSERT INTO `service_comments` VALUES (50, 32, 76, '　　原本規劃為五天，卻因遇颱風而中斷為四天的活動中，小朋友都是依依不捨的與志工們道別。他們向志工們表示，雖然這次的營隊活動都是不認識的大哥哥大姊姊們，但是我們設計的活動他們都很喜歡。希望我們寒假也能去他們學校辦理冬令營。 \n　　由這次的夏令營活動，不管是小朋友或是工作人員都獲得了許多的成長。小朋友方面，我們得到了許多的回饋，本次參與活動的小朋友符合預期，部分小朋友的家庭是外籍所組成，部分小朋友為本國籍家庭組成，在活動遊戲中的共明也相當足夠，與我們想傳遞的理念十分契合。 \n　　在工作人員方面，這次所參與營隊的工作人員大部分都是第一次舉辦夏令營，在每天的檢討會議以及課程的設計上，都下了十足的心血。在經過了四天的活動後，工作人員們都獲的了很多很多的成長。於本次的夏令營中，我們確實地在分享、實作以及遊戲中，融合多元的理念，告訴孩子對於新住民的正確認知，並且建立起新住民之子女學子的自我認知。', '2018-07-31 06:19:47', '::1', 2);
